import React from "react";
import { MDBBreadcrumb, MDBBreadcrumbItem, Container } from "mdbreact";



const BreadCrumbs = props => {
  return (
    <Container>

      <MDBBreadcrumb color="white pink">
        <MDBBreadcrumbItem iconRegular icon="circle">Home</MDBBreadcrumbItem>
        <MDBBreadcrumbItem iconRegular icon="circle">Library</MDBBreadcrumbItem>
        <MDBBreadcrumbItem icon Small icon="circle" >Data</MDBBreadcrumbItem>
      </MDBBreadcrumb>
    </Container>
  );
};

export default BreadCrumbs;

// active
